int maxArea(int* height, int heightSize)
{
    int left_p = 0;
    int right_p = heightSize-1;
    int max = 0;
    int tmp_max = 0;

    while (left_p < right_p)
    {
        if (height[left_p] <= height[right_p])
        {
            tmp_max = (right_p-left_p) * height[left_p];
        }
        else
        {
            tmp_max = (right_p-left_p) * height[right_p];
        }
        
        if (tmp_max >= max)
        {
            max = tmp_max;
        }

        if (height[left_p] <= height[right_p] )
        {
            left_p ++;
        }
        else
        {
            right_p --;
        }
    }
    return max;
}

